import React from 'react'

import './Header.css'
import Button from '../Button'
import { empty } from '../../utils'


export default function Header() {

    return (
        <div className="header">
            <div className="header__center">
                <div className="header__logo" />
                <input
                    className="header__search"
                    placeholder="Поиск"
                />
                <RedButton
                    text={ 'Загрузить отчёт' }
                    // TODO: переход на страницу с загрузкой отчёта
                    onClick={ empty }
                />
            </div>
        </div>
    )
}

interface RedButtonProps {
    text: string
    onClick: any
}

function RedButton({ text, onClick } : RedButtonProps) {
    return (
        <Button className="header-red-button" onClick={ onClick }>
            { text }
        </Button>
    )
}
